import React, { Component } from 'react';
import 'assets/css/App.css';
import ReactDOM from 'react-dom';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <p>O jogo.</p>
        </header>
      </div>
    );
  }
}

ReactDOM.render(<App />, document.getElementById('root'));

export default App;
